// Booking.js
import React from 'react';
import Banner from "src/components/banner.js";
import Footer from "src/components/footer.js";
import "src/styles/booking.css";
import { MapContainer, TileLayer, useMap, Marker, Popup } from 'react-leaflet'

function Article(){
    return <div class="articleBooking"></div>

}

function Aside(){
    return <div class="asideBooking" style={{height: "300px"}}>
          <MapContainer center={[55.705053, 12.585333]} zoom={15} scrollWheelZoom={false}>
            <TileLayer
                attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            />
            <Marker position={[55.705053, 12.585333]}>
                <Popup>
                A pretty CSS3 popup. <br /> Easily customizable.
                </Popup>
            </Marker>
        </MapContainer>
    </div>
}

function Booking(){
    return <div class="grid" style={{width: "70vw", margin: "auto"}}>
        <Banner/>
        <Article/>
        <Aside/>
        <Footer/>
    </div>;
}

export default Booking;
